-- Table structure for `users`
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `login_name` varchar(50) DEFAULT NULL,
  `nickname` varchar(255) NOT NULL DEFAULT '' COMMENT '用户昵称',
  `login_wx` varchar(50) DEFAULT NULL,
  `login_qq` varchar(50) DEFAULT NULL,
  `login_wb` varchar(50) DEFAULT NULL,
  `login_moblie` varchar(20) DEFAULT NULL,
  `pass` varchar(50) DEFAULT NULL,
  `salt` varchar(20) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `cash_account` varchar(100) DEFAULT NULL COMMENT '提现账号',
  `cash_name` varchar(100) DEFAULT NULL COMMENT '提现人姓名',
  `vod` varchar(50) DEFAULT NULL,
  `price` float(11,2) NOT NULL DEFAULT '2.00' COMMENT '价格',
  `auth_state` int(11) DEFAULT '0' COMMENT '认证状态0,开始,1待认证,2是通过',
  `reference` int(11) NOT NULL DEFAULT '0' COMMENT '推荐人',
  `reference_time` int(11) NOT NULL DEFAULT '0' COMMENT '推荐到期时间',
  `is_black` int(11) NOT NULL DEFAULT '0' COMMENT '黑名单',
  `add_time` int(11) NOT NULL DEFAULT '0',
  `is_fill` int(11) NOT NULL DEFAULT '0' COMMENT '是否完整信息',
  `is_disturb` int(11) NOT NULL DEFAULT '0',
  `host_type` varchar(10) DEFAULT 'new',
  `stick` varchar(10) DEFAULT NULL,
  `stick_time` int(11) DEFAULT NULL,
  `online_state` varchar(10) DEFAULT NULL,
  `request_time` int(11) NOT NULL DEFAULT '10' COMMENT '请求时间',
  `answer_rate` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `login_moblie` (`login_moblie`) USING BTREE,
  UNIQUE KEY `login_name` (`login_name`) USING BTREE,
  UNIQUE KEY `login_qq` (`login_qq`) USING BTREE,
  UNIQUE KEY `login_wx` (`login_wx`) USING BTREE,
  UNIQUE KEY `login_wb` (`login_wb`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=232148 DEFAULT CHARSET=utf8mb4;

